function request(url, method, params = {}, data = {}, header = {}) {
  const token = uni.getStorageSync('token');
  if (!token) {
    // console.log('Token未添加');
    // return Promise.reject(new Error('No token available'));
  }
  // 添加自定义的channel头
  header.channel = 'app'; // 这里直接添加
  header.Authorization = '';

  // 对于GET请求，将params对象转换为查询字符串
  const query =
    method === 'GET'
      ? '?' +
        Object.keys(params)
          .filter((key) => params[key] !== undefined && params[key] !== null)
          .map((key) => `${encodeURIComponent(key)}=${encodeURIComponent(params[key])}`)
          .join('&')
      : '';

  return new Promise((resolve, reject) => {
    uni.request({
      url: baseUrl + url + (method === 'GET' ? query : ''),
      method: method,
      data: method === 'POST' ? data : {}, // 对于POST请求，使用data
      header: {
        'content-type': 'application/json',
        ...header,
      },
      success: (res) => {
        if (res.statusCode === 200) {
          resolve(res.data);
        } else {
          reject(new Error(res.data.message || '请求失败'));
        }
      },
      fail: (err) => {
        reject(err);
      },
    });
  });
}

function get(url, params = {}, header = {}) {
  return request(url, 'GET', params, {}, header);
}

function post(url, data = {}, header = {}) {
  return request(url, 'POST', {}, data, header);
}

export { get, post };
